import React from 'react'
import './Preview.css'

class Preview extends React.Component {
    render () {
        return (
            <div className="Preview">
                <div className="bookmarkImage"></div>
                <div className="bookmarkTitle"></div>
                <div className="bookmarkDes"></div>
            </div>
        )
    }
}

export default Preview
